// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

uint256 constant VISI_BILIETAI = 10;

contract Bilietai {
    address public owner; // Owner of the contract
    uint256 public earlyBirdDiscount = 50; // Early discount percentage for first 3 tickets
    uint256 public ticketsSold = 0; // Track tickets sold

    struct Bilietas {
        uint256 kaina;
        uint256 moketaKaina; // Actual price paid by the buyer
        address kieno;
        string data;
        string vieta;
    }


    Bilietas[VISI_BILIETAI] public bilietai;

    constructor() {
        owner = msg.sender; // Set the contract deployer as the owner
        for (uint256 i = 0; i < VISI_BILIETAI; i++) {
            bilietai[i].kaina = 1e18; // 1 ETH as base price
            bilietai[i].kieno = address(0x0); // Available for purchase
            bilietai[i].data = ""; // Empty date by default
            bilietai[i].vieta = ""; // Empty location by default
        }
    }

    // Modifier to check if the sender is the owner
    modifier onlyOwner() {
        require(msg.sender == owner, "You are not the owner.");
        _;
    }

    event TicketPurchased(address buyer, uint256 finalPrice, uint256 ticketsSoldCount);

    function pirktiBilietus(uint256 _index) external payable {
        require(_index < VISI_BILIETAI && _index >= 0, "Invalid ticket index.");
        require(bilietai[_index].kieno == address(0x0), "Ticket is already sold.");
        
        uint256 finalPrice = bilietai[_index].kaina;

        // Apply early bird discount if less than 3 tickets sold
        if (ticketsSold < 3) {
            finalPrice = 5e17; // 50% of the original price
        }

        require(msg.value >= finalPrice, "Insufficient funds to purchase.");

        bilietai[_index].kieno = msg.sender;
        bilietai[_index].moketaKaina = finalPrice; // Store the actual amount paid

        // Increment ticket count
        ticketsSold++;

        // Emit event to track the purchase
        emit TicketPurchased(msg.sender, finalPrice, ticketsSold);

        // Refund any excess funds
        if (msg.value > finalPrice) {
            payable(msg.sender).transfer(msg.value - finalPrice);
        }
    }



    // Request a refund for a ticket (before an event starts)
    function grazintiBilietas(uint256 _index) external {
        require(_index < VISI_BILIETAI, "Invalid ticket index.");
        require(bilietai[_index].kieno == msg.sender, "You do not own this ticket.");
        
        uint256 refundAmount = bilietai[_index].moketaKaina; // Refund the actual amount paid

        // Set ticket as available again and refund the owner
        bilietai[_index].kieno = address(0x0);
        bilietai[_index].moketaKaina = 0; // Reset paid price to 0
        payable(msg.sender).transfer(refundAmount);
    }


}
